// Bubble sort
void bubble_sort(int arr[], int n){
    for(int j = n; j > 0; j--){
        for(int i = 1; i < j; i++){
            if(arr[i-1]>arr[i]){
                int temp = arr[i-1];
                arr[i-1] = arr[i];
                arr[i] = temp;
            }
        }
    }
}

