void Swap(int* lef, int* rig){
    int temp = *lef;
    *lef = *rig;
    *rig = temp;
}

void Bubble(int arr[] , int SIZE){
    for(int i = 1; i < SIZE; i ++){
        int count = 0;
        for(int j = 0; j < SIZE - 1; j++){
            if(arr[j] > arr[j+1]){
                Swap(&arr[j],&arr[j+1]);
                count++;
            }
        }
        if(count == 0)
            break;
    }
}

